import React from 'react';
// import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div id="header">
        <span>Logo Goes Here</span> <span>You guessed right/wrong!</span> <span>Score: 12 | Top Score: 12</span>
      </div>
      <div id="second-header">
        <h1>Clicky Game</h1>
        <p>Click on an image to earn points, but don't click on any more than once!</p>
      </div>
      <div id="gameBody">
        <img src="./images/1.png"/>
      </div>
      <div id="footer">
        <p>Some footer stuff</p>
      </div>
    </div>
  );
}

export default App;
